import React from 'react'


const TesterResultsList = ({results}) => {
  return (
    <div >
      HERE
      {results.map((result, id) => {
        return 
          <div>
                    <div key={id}>{result.title}</div>
                    return <div key={id}>{result.image_url}</div>


          </div>
        


      })}


    </div>
  )
}

export default TesterResultsList;
